    public static Supplier<BigDecimal> generator(int startAt) {
        AtomicInteger ref = new AtomicInteger(startAt);
        return () -> divide(valueOf(ref.getAndIncrement()),100);
    }

    public static Supplier<PriceAction> priceGenerator(int startAt) {
        return priceGenerator(valueOf(startAt), (bd, ignore) -> add(bd, BigDecimalOps.ONE_CENT));
    }

    public static Supplier<PriceAction> priceGenerator(BigDecimal startAt, BinaryOperator<BigDecimal> f) {
        AtomicReference<BigDecimal> ref = new AtomicReference<>(startAt);
        return new PriceGenerator(() -> ref.accumulateAndGet(startAt, f), () -> multiply(ref.get(), 1000).intValue());
    }

    @AllArgsConstructor
    public static class PriceGenerator implements Supplier<PriceAction> {

        private Supplier<BigDecimal> openSupplier;
        private Supplier<BigDecimal> highSupplier;
        private Supplier<BigDecimal> lowSupplier;
        private Supplier<BigDecimal> closeSupplier;
        private Supplier<Integer> volSupplier;

        public PriceGenerator(Supplier<BigDecimal> priceSupplier, Supplier<Integer> volSupplier) {
            openSupplier = priceSupplier;
            highSupplier = priceSupplier;
            lowSupplier = priceSupplier;
            closeSupplier = priceSupplier;
            this.volSupplier = volSupplier;
        }

        @Override
        public PriceAction get() {
            return new PriceAction() {
                @Override
                public BigDecimal getOpen() {
                    return openSupplier.get();
                }

                @Override
                public BigDecimal getHigh() {
                    return highSupplier.get();
                }

                @Override
                public BigDecimal getLow() {
                    return lowSupplier.get();
                }

                @Override
                public BigDecimal getClose() {
                    return closeSupplier.get();
                }

                @Override
                public int getVolume() {
                    return volSupplier.get();
                }
            };
        }
    }
